	"A Case Study Find Peace in Meditation",
	"A Case Study Enjoy Fashion Shows From Home",
	"Branding Chicken Barbeque Never Goes Wrong",
];

export function Projects() {
	return (
		<StyledProjects>
			<SectionTitle>MY PROJECTS</SectionTitle>
			<FlexWrapper>
				<Menu menuItems={projectItems}></Menu>

			</FlexWrapper>
		</StyledProjects>
	);
}

const StyledProjects = styled.section``;

const SectionTitle = styled.h2``;
